# Data Administrator - Process deletions by date
def process_deletions_by_date(cutoff_date: datetime) -> int:
    """Delete records older than cutoff_date and return count of deleted records."""
    engine = sqlalchemy.create_engine("database_connection_string")
    query = f"DELETE FROM records WHERE created_at < '{cutoff_date}'"
    with engine.connect() as conn:
        result = conn.execute(query)
        return result.rowcount

