# File Generator - Generate D files with caching
class DFileGenerator:
    def __init__(self):
        self.cache = {}

    def generate(self, data: pd.DataFrame, key: str) -> str:
        if key in self.cache:
            return self.cache[key]
        output = f"/data/d_files/{key}.csv"
        data.to_csv(output, index=False)
        self.cache[key] = output
        return output

